	@Override
	public  List<String> writeImgReadilyShoot(String reportSerialNumber, List<StVo> base64Imgs)throws Exception {
		String baseUrl = "http://gzh.stc.gov.cn/fileserver/img/";
		List<String> imgPaths = new ArrayList<String>();
		//序列号为文件夹名称
		//日期+数字
		String basePath = "/opt/file/img";
		//String basePath = "D:\\opt";
		File file = new File(basePath + "/" + reportSerialNumber);
		file.setWritable(true, false);
		if(!file.exists()){
			file.mkdirs();
		}
		if(null != base64Imgs && base64Imgs.size() > 0){
			for(StVo stVo : base64Imgs){
				String random = RandomUtil.randomString(5);
				Long long1 = System.currentTimeMillis();
				String path = basePath + "/" + reportSerialNumber + "/" + long1 + random + ".jpg";
				String imgPath = reportSerialNumber + "/" + long1 + random + ".jpg";
				boolean flag = generateImage(stVo.getBase64Img(), path);
				if(flag){
					ImgGzip.reduceImg(path, path, 806, 454,null);
					//logger.info("加水印图片为：" + path);
					logger.info("加水印数据为：" + stVo.getImgDateTime());
					/*if(StringUtils.isNotBlank(stVo.getImgDateTime())){
						ImageMarkUtil.pressText(path, stVo.getImgDateTime(), "宋体", Font.BOLD, 30, Color.RED, -1, -1, 1.0f);
					}*/
					imgPaths.add(baseUrl + imgPath);
				}
			}
		}
		return imgPaths;
	}
	
	public void gziImgOld()throws Exception{
		String imgsPath = "/opt/file/img";
		File file = new File(imgsPath);
		if(file.exists()){
			String[] file1s = file.list();
			for(String file1 : file1s){
				File file2 = new File(imgsPath +"/"+ file1);
				if(file2.isDirectory()){
					String[] imgFiles = file2.list();
					for(String imgFile : imgFiles){
						String imgPath = file2  +"/"+ imgFile;
						ImgGzip.reduceImg(imgPath, imgPath, 806, 454,null);
					}
				}
			}
		}
	}
	
	/**
	 * base64转成图片地址
	 * @param base64Str
	 * @param path
	 * @return
	 */
	public static boolean generateImage(String base64Str, String path) {
		if (base64Str == null)
			return false;
		try {
			// 解密
			byte[] b = Base64.decodeBase64(base64Str);
			// 处理数据
			for (int i = 0; i < b.length; ++i) {
				if (b[i] < 0) {
					b[i] += 256;
				}
			}
			OutputStream out = new FileOutputStream(path);
			out.write(b);
			out.flush();
			out.close();
			return true;
		} catch (Exception e) {
			return false;
		}
	}
	/**
	 * 图片转成base64
	 * @param imgFile
	 * @return
	 */
	public static String getImageStr(String imgFile) {
	    InputStream inputStream = null;
	    byte[] data = null;
	    try {
	        inputStream = new FileInputStream(imgFile);
	        data = new byte[inputStream.available()];
	        inputStream.read(data);
	        inputStream.close();
	    } catch (IOException e) {
	        e.printStackTrace();
	    }
	    // 加密
	    return Base64.encodeBase64String(data);
	}

	@Override
	public String uploadAdminWeb(File file,String pf)throws Exception {
		logger.info("获取深圳交警便民后台上传图片URL...");
		String uploadAdminUrl = PropertyUtil.getProperty("uploadAdminUrl"); 
		logger.info("深圳交警便民后台上传图片URL=" + uploadAdminUrl);
		String basePath = "/opt/file/img/admin/";
		File fileNew = new File(basePath);
		if(!fileNew.exists()){
			fileNew.mkdirs();
		}
		FileInputStream stream =new FileInputStream(file);
		String random = RandomUtil.randomString(5);
		Long long1 = System.currentTimeMillis();
		String fileName = long1 + random + "." + pf;
		String uploadPath = basePath + fileName;
		FileOutputStream fs=new FileOutputStream(uploadPath);   
        byte[] buffer =new byte[1024*1024];   
        int bytesum = 0;   
        int byteread = 0;    
        while ((byteread=stream.read(buffer))!=-1)   
        {   
           bytesum+=byteread;   
           fs.write(buffer,0,byteread);   
           fs.flush();   
        }    
        fs.close();   
        stream.close();
        return uploadAdminUrl + fileName;
	}
	
	@Override
	public String uploadFile(InputStream inputStream, String pf)
			throws Exception {
		FileOutputStream fs = null;
		try {
			String fileName = System.currentTimeMillis() + RandomUtil.randomString(5) + "." + pf;
			String path = "/opt/file/img/face/" + fileName;
			File file = new File(path);
			
			// 判断文件路径是否存在
            if (!file.getParentFile().exists()) {
                // 如果文件不存在就创建文件
                file.getParentFile().mkdirs();
            }
            
			if(!file.exists()){
				file.mkdirs();
			}
			
			fs = new FileOutputStream(path);   
	        byte[] buffer =new byte[1024*1024];   
	        int size = 0;    
	        while ((size=inputStream.read(buffer))!=-1)   
	        {   
	           fs.write(buffer,0,size);   
	           fs.flush();   
	        }    
	        return fileName;
		} catch (Exception e) {
			logger.error("保存文件异常",e);
		}finally{
			if(null != inputStream)
				inputStream.close();
			
			if(null != fs)
				fs.close();
		}
		return "";
	}
	
